import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import FilteredList from './FilteredList'

import { AwesomeButton } from "react-awesome-button";
import { Dropdown } from 'react-bootstrap';
import "react-awesome-button/dist/styles.css";
import 'bootstrap/dist/css/bootstrap.min.css';

class App extends React.Component {

  constructor(props) {
    super(props);
  }


  render() {

    const stocks = [
      {name: "Apple Inc.", stockPrice: 100.24, sector: "technology"},
      {name: "Microsoft Corperation", stockPrice: 80.16, sector: "technology"},
      {name: "Adobe Inc.", stockPrice: 55.91, sector: "technology"},
      {name: "Samsung Electronics Co.", stockPrice: 55.15, sector: "technology"},
      {name: "Delta", stockPrice: 35.44, sector: "Airline"},
      {name: "JetBlue", stockPrice: 15.76, sector: "Airline"},
      {name: "American Airlines", stockPrice: 15.56, sector: "Airline"},
      {name: "United Airlines", stockPrice: 21.87, sector: "Airline"},
      {name: "Starbucks Corporation", stockPrice: 1.50, sector: "food"},
      {name: "McDonald's Corporation", stockPrice: 35.00, sector: "food"},
      {name: "Domino’s Pizza Inc", stockPrice: 17.00, sector: "food"},
      {name: "Chipotle Mexican Grill Inc", stockPrice: 15.00, sector: "food"},
    ];


    return (
      <div>
        <FilteredList list={stocks} />
      </div>
    )
  }
}

export default App;
